<template>
  <div id="M8_banner" class="clearfix">
    <div class="owl-carousel owl-theme" id="owl-banner">
      <div  v-for="(item, index) in owldot" class="item-banner" :class="item.isActive"></div>
    </div>
    <ul class="owl-dots" id="owl-banner-dots">
      <li v-for="(item, index) in owldot" @click="owldotfn(index)">
        <img :src="item.src">
      </li>
    </ul>
  </div>
</template>

<script>
  import $ from 'jquery'
  import '../../js/owl.carousel'
  export default {
    data (){
        return {
            owldot:[
              {id:0,src:'data:image/png;base64,',isActive: "banner_1",},
              {id:1,src:'data:image/png;base64,',isActive: "banner_2",},
              {id:2,src:'data:image/png;base64,',isActive: "banner_3",},
            ]
        }
    },
    ready () {
    },
    mounted: function () {
      $('#owl-banner').owlCarousel({
        items:1,
        loop:true,
        nav:false,
        dots:true,
        animateOut: 'fadeOut',
        dotsContainer: '#owl-banner-dots'
      });
    },
    methods :{
      owldotfn:function(index) {
          $('#owl-banner').trigger('to.owl.carousel', [index, 300]);
      }
    }
  }
</script>
